import './App.css';
import { UserList } from './Details/UserList';
import { Routes, Route } from 'react-router-dom';
import { CreateAccount } from './Details/CreateAccount';
import { Edit } from './Details/EditAccount.js'
import { Movies } from './Movies/Movies';
import Login from './Details/Login';
import Register from './Details/Register';
import DataTable from './Details/DataTable';



function App() {
  return (
    <div className="App">
      <Routes >
        <Route path='/' element={<Register/>}/>
        <Route path='/login' element={<Login />} />
        <Route path='/' element={<DataTable/>} />
        <Route path='/create' element={<CreateAccount />} />
        <Route path='/user-list' element={<UserList />} />
        <Route path='/edit/:id' element={<Edit />} />
        <Route path='/movies'  element={<Movies/>} />
      </Routes>
    </div>
  );
}

export default App;
